import { FaArrowRight } from 'react-icons/fa'; // Add this line for the arrow icons

function Navbar({ parentSections }) {
  return (
    <nav className="w-64 h-screen fixed bg-gradient-to-b from-gray-900 via-gray-800 to-black text-gray-300 shadow-lg overflow-y-auto border-r border-gray-700">
      <div className="p-6">
        <h2 className="text-3xl font-bold mb-6 text-cyan-400 text-center drop-shadow-lg">Image Filters</h2>
        <ul className="space-y-8">
          {parentSections.map((parent) => (
            <li key={parent.id} className="group">
              <a
                href={`#${parent.id}`}
                className="hover:text-cyan-300 text-xl transition-colors duration-300 block flex items-center justify-between"
              >
                {parent.title}
                <FaArrowRight className="transition-transform transform group-hover:translate-x-2" />
              </a>
              <ul className="pl-4 mt-2 space-y-4">
                {parent.sections.map((section) => (
                  <li key={section.id} className="group">
                    <a
                      href={`#${section.id}`}
                      className="hover:text-cyan-300 transition-colors duration-300 block flex items-center"
                    >
                      {section.title}
                      <FaArrowRight className="transition-transform transform group-hover:translate-x-2 ml-2" />
                    </a>
                  </li>
                ))}
              </ul>
            </li>
          ))}
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
